def return_binary_or_hexa(integers):
    a = integers[37]
    b = integers[43]
    total = 0
    for i in range(a + 1, b):
        if i not in integers[37:44]:
            total += i

    if total == 0:
        return ""

    if total % 2 == 1:
        return bin(total)[2:]
    else:
        return hex(total)[2:]
